import React from "react";

const SetLeft = ({setCom}) => {
  return (
    <>
      <div className="">
        <div className="adminNav">
          <ul>
            <li className="lk" onClick={(ev)=>{setCom("dashboard");ev.target.classList.add('lihover');}}><i className="fa fa-bar-chart me-2"></i>Dashboard</li>
            <li className="lk" onClick={(ev)=>{setCom("profile");
            document.getElementsByClassName('lk').classList.remove('lihover')
            }}><i className="fa fa-user me-2" aria-hidden="true"></i>Profile</li>
            <li className="lk" onClick={(ev)=>{setCom("api");}}><i className="fa fa-globe me-2" aria-hidden="true"></i>Api's</li>
            <li className="lk" onClick={(ev)=>{setCom("users");}}>Users</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default SetLeft;
